def get_required_voxels_for_subject(subject):
    pearson_correlated_voxels = set()
    top_k_common_voxels = set()
    for i, voxels in enumerate(ds03507_pearson_indexes):
        if i == int(subject) - 1:
            continue
        for voxel in voxels:
            pearson_correlated_voxels.add(voxel)

    voxel_count_dict = defaultdict(int)
    for i, voxels in enumerate(ds03507_top_5000_indices):
        if i == int(subject) - 1:
            continue
        for voxel in voxels:
            voxel_count_dict[voxel] += 1
            if voxel_count_dict[voxel] == 3:
                top_k_common_voxels.add(voxel)

    return list(pearson_correlated_voxels.intersection(top_k_common_voxels))

